INSERT INTO "public"."product" ("id", "title", "price", "desc", "preview_pic_id") VALUES
('2f39d0ec-53d6-4c37-a750-3783703e11ec', 'เลย์คลาสสิค รสโนริสาหร่าย 46 กรัม', 22, 'เลย์คลาสสิค รสโนริสาหร่าย มันฝรั่งแท้ทอดกรอบแผ่นเรียบ รสโนริสาหร่าย ผลิตจากมันฝรั่งคุณภาพเยี่ยม เคี้ยวเพลิน กรอบ หอม อร่อยทุกชิ้น เต็มแผ่นเรียบ คำโต เคี้ยวมัน สามารถรับประทานได้ทุกที่ทุกเวลา ใช้รับประทานเป็นของว่างในเวลาสังสรรค์ ช่วงวันหยุด หรือรับประทานกับเพื่อนหรือครอบครัว สามารถสั่งซื้อได้แล้ว ผ่านทางเว็บไซต์ของเรา สะดวกสบาย ในราคาที่จับต้องได้ ช้อปเลย!', '543172b5-a997-492e-b35d-395cef010f09');
INSERT INTO "public"."product" ("id", "title", "price", "desc", "preview_pic_id") VALUES
('c9125340-e3c9-4e47-8256-7e9474372ea7', 'เลย์คลาสสิค รสมันฝรั่งแท้ 46 กรัม', 22, 'ผลิตจากมันฝรั่งคุณภาพเยี่ยมแผ่นเรียบรสมันฝรั่งแท้ เคี้ยวเพลิน กรอบ หอม อร่อย รับประทานได้หลากหลายโอกาส', '79a2b964-2092-4439-bf93-53a55d96aa0c');
INSERT INTO "public"."product" ("id", "title", "price", "desc", "preview_pic_id") VALUES
('6f9b1af8-54a7-4529-885c-fbdd9c843992', 'โรลเลอร์โคสเตอร์ มันฝรั่งรูปวงรสชีสต้นตำรับ 54 กรัม', 20, 'มันฝรั่งทอดกรอบ รสชีสต้นตำรับ กรอบ หอม อร่อยรับประทานได้หลากหลายโอกาส ไม่ว่าจะเป็นของว่าง หรือช่วงเวลาสนุกๆ', 'a5a9c845-27ce-449f-a8b7-62a1ed952ef8');
INSERT INTO "public"."product" ("id", "title", "price", "desc", "preview_pic_id") VALUES
('449f97ac-ce1f-4c84-87ad-bb3722da5d68', 'โตโร ข้าวโพดเคลือบรสซูปเปอร์คาราเมล 55 กรัม', 15, 'โตโร ข้าวโพดเคลือบรสซูปเปอร์คาราเมล รสชาติเข้มข้น หอมกลิ่นคาราเมล ตั้งแต่เปิดซอง เข้ากันอย่างลงตัวกับข้าวโพดอบกรอบสามารถกินแทนป๊อปคอร์นระหว่างดูหนังได้ เพลินๆไม่มีเบื่อ', '027fb975-09d0-43f9-a571-71e9647cea5c'),
('adec44a0-dbc4-4267-96a1-c8e9e4ecae10', 'เวอร์เธอร์ ออริจินอล คาราเมล ป๊อปคอร์น คลาสสิค 140 กรัม', 139, 'เวอร์เธอร์ ออริจินอล คาราเมล ป๊อปคอร์น ข้าวโพดคั่วเพียงหนึ่งเดียว ที่มีคาราเมลดั้งเดิมของ Werther ที่เข้มข้น และครีมมี่ ป๊อปคอร์นกรุบกรอบ หวาน หอม อร่อย เพื่อให้เป็นของว่างที่สมบูรณ์แบบพื่อตอบสนองสายหวาน', '7d97051f-a726-433c-845b-bf121e3085b0'),
('b41eb438-842d-4df2-9d1d-362790a37df4', 'กูลิโกะป๊อกกี้ บิสกิตแท่งเคลือบรสช็อกโกแลต 45 กรัม', 21, 'กูลิโกะป๊อกกี้ ความอร่อยลงตัว หอมเข้มข้นกว่าเดิม เต็มรสช็อกโกแลต ที่เป็นเอกลักษณ์เฉพาะสไตล์กูลิโกะ สนุกเพลิดเพลิน กับความกรอบยิ่งขึ้น ของแท่งบิสกิตใหม่ผสมไฟเบอร์ สามารถสั่งซื้อได้แล้ว ผ่านทางเว็บไซต์ของเรา สะดวกสบาย ในราคาที่จับต้องได้ ช้อปเลย!', '5a7978f8-aeaa-4475-bd6b-d5f73d1b0325'),
('94e96f3e-d612-4299-85f3-0f010d1a3e6c', 'โอรีโอ คุกกี้แซนวิชสอดไส้ครีมวานิลลา 36.8 กรัม', 8, 'โอรีโอเป็นขนมแซนวิชคุกกี้ที่เป็นชื่นชอบของคนทั่วโลกมากว่า 100 ปี ด้วยรสชาติที่เป็นเอกลักษณ์ของตัวคุกกี้รสช็อกโกแลต เข้ากันได้อย่างลงตัวกับความเข้มข้นของครีมวานิลลาสุดคลาสสิค รสชาติอร่อย ถูกใจทุกเพศทุกวัย พร้อมบิด ชิมครีม จุ่มนมได้ทุกวัน', '63cd4093-5bf0-45e9-8ed6-00716487394b'),
('659f2a68-6e92-4d1e-a335-2eecaebe85a3', 'โออิชิน้ำผึ้งผสมมะนาว 380 มล.', 19, 'โออิชิชาเขียวรสน้ำผึ้งผสมมะนาว เครื่องดื่มชาเขียวที่มาจากชงจากใบชาเขียวธรรมชาติ พิถีพิถันในการคัดสรรยอดอ่อนใบชาคุณภาพ 3 ใบ ก่อนเข้าสู่กระบวนการผลิตที่ได้มาตรฐานระดับโลกแห่งแรกในประเทศไทย เพื่อให้ได้มาซึ่งรสชาติและคุณประโยชน์ของชาเขียวต่อร่างกายไว้ให้ดีที่สุด ใบชาเขียวธรรมชาติปลอดสารเคมี 100% ไม่ใช้วัตถุกันเสีย,ไม่เจือสีสังเคราะห์ ผสานรสชาติน้ำผึ้งมะนาว เปรี้ยวหวาน มอบความสดชื่น เติมพลังให้ร่างกายได้ทุกวัน แบบขวดดื่มง่าย พกพาไปได้ทุกที่ สามารถสั่งซื้อได้แล้ว ผ่านทางเว็บไซต์ของเรา สะดวกสบาย ในราคาที่จับต้องได้ พร้อมร่วมลุ้นดีลหรือคูปองพิเศษ ๆ สำหรับคุณลูกค้าทุกท่านได้อีกมากมาย ช้อปเลย!', '72988128-f4ac-47ab-9c50-23b3d598741f'),
('20590cd4-e0f5-4cbc-a7ee-7a5ab3472235', 'เบอร์ดี้ คาเฟ่ แบล็ค 250 มล.', 35, 'เติมความสดชื่นให้วันของคุณไปกับ เบอร์ดี้ คาเฟ่ แบล็ค ที่ถูกคัดสรรอย่างดีจากเมล็ดกาแฟไทย พร้อมเสิร์ฟความเข้มของกาแฟดำเต็มแก้ว และกลิ่นหอมของกาแฟคั่วเข้ม สูตรไม่มีน้ำตาล', '412f10bd-d103-4b04-8b11-a6714d8fbb06'),
('41aad312-bf9f-4afe-be54-13ccea9ccb50', 'ดอยคำ น้ำเก็กฮวยและคาโมไมล์ สูตรไม่เติมน้ำตาล 500 มล.', 32, 'ดอยคำ น้ำเก็กฮวยและคาโมไมล์ สูตรไม่เติมน้ำตาล', 'f034f859-407a-4aa3-9850-0997e3c7a697');